// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Caa is ERC20 {
    // Mapping để lưu địa chỉ admin
    mapping(address => bool) public admins;

    // Các sự kiện để frontend có thể phát hiện
    event AdminAdded(address indexed newAdmin);
    event AdminRemoved(address indexed removedAdmin);
    event TokensMinted(address indexed to, uint256 amount);
    event TokensTransferred(address indexed from, address indexed to, uint256 amount);
    event ETHTransferred(address indexed to, uint256 amount);

    constructor() ERC20("EducationToken", "EDU") {
        admins[msg.sender] = true;
        _mint(msg.sender, 10000 * 10 ** decimals());
    }

    // Modifier để kiểm tra xem người gọi có phải là admin không
    modifier onlyAdmin() {
        require(admins[msg.sender], "Only admin can perform this action");
        _;
    }

    // Hàm để thêm admin mới
    function addAdmin(address newAdmin) external onlyAdmin {
        require(!admins[newAdmin], "Address is already an admin");
        admins[newAdmin] = true;
        emit AdminAdded(newAdmin);
    }

    // Hàm để xóa admin
    function removeAdmin(address adminAddress) external onlyAdmin {
        require(admins[adminAddress], "Address is not an admin");
        admins[adminAddress] = false;
        emit AdminRemoved(adminAddress);
    }

    // Hàm để mint token cho address giảng viên
    function mint(address to, uint256 amount) external onlyAdmin {
        _mint(to, amount);
        emit TokensMinted(to, amount);

        // Sau khi mint token, chuyển một số ETH cho giảng viên (ví dụ: 0.01 ETH)
        payable(to).transfer(0.01 ether); // Chuyển 0.01 ETH vào ví của giảng viên
        emit ETHTransferred(to, 0.01 ether);
    }

    // Hàm để chuyển token cho address giảng viên
    function transferTokens(address to, uint256 amount) external onlyAdmin {
        require(balanceOf(msg.sender) >= amount, "Insufficient balance to transfer tokens");
        _transfer(msg.sender, to, amount);
        emit TokensTransferred(msg.sender, to, amount);

        // Sau khi chuyển token, chuyển một số ETH cho người nhận (ví dụ: 0.01 ETH)
        payable(to).transfer(0.01 ether); // Chuyển 0.01 ETH vào ví của người nhận
        emit ETHTransferred(to, 0.01 ether);
    }

    // Hàm để nạp ETH vào hợp đồng (ví dụ: nạp ETH từ admin vào hợp đồng)
    receive() external payable {}

    // Hàm để admin rút ETH từ hợp đồng (dành cho mục đích khác)
    function withdrawETH(uint256 amount) external onlyAdmin {
        require(address(this).balance >= amount, "Insufficient ETH balance in contract");
        payable(msg.sender).transfer(amount);
    }
}

